app.views.project=Backbone.View.extend({initialize:function(){console.log("initializing project view")},render:function(){$(this.el).html(this.template());$(document).attr("title","darkroom locator - find and share darkrooms | "+this.language.type+" | "+this.language.lang);return this},destroy_view:function(){this.undelegateEvents();$(this.el).removeData().unbind();this.remove();Backbone.View.prototype.remove.call(this);app.global.projectView=null}})